import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

const Router = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" component={AllPosts} />
      </Switch>
    </BrowserRouter>
  );
};

export default Router;
